import React from 'react';
import image from './image'

const Header=({name,status})=>{
    return(
        <div className='header'>
            <div className='img'>
                <image src={image} alt='' />
            </div>
            <div className='right'>
                <div className='name'>{name}</div>
                <div className='status'>{status}</div>
            </div>
        </div>
    )
}

export default Header;
